// Challenge / Exercise
import { createBrowserRouter, RouterProvider } from "react-router-dom";
import Root from "./components/RootLayout";
import Home from "./page/Homepage";
import EventDeatils from "./page/EventDetailsPage";
import NewEvent from "./page/NewEventPage";
import Events from "./page/Eventspage";
import EditEvent from "./page/EditEventPage";


// BONUS: Add another (nested) layout route that adds the <EventNavigation> component above all /events... page components

const router = createBrowserRouter([
  {
    path: "/",
    element: <Root />,
    children: [
      {index: true, element: <Home />},
      { path: "/events", element: <Events /> },
      { path: "/events/:eventId", element: <EventDeatils /> },
      { path: "/events/new", element: <NewEvent /> },
      { path: "/events/:eventId/edit", element: <EditEvent /> },
    ],

  },
]);

function App() {
  return <RouterProvider router={router} />;
}

export default App;
